// src/components/CustomerForm.js
import React, { useState, useEffect } from 'react';

const CustomerForm = ({ customer, onSubmit }) => {
  const [formData, setFormData] = useState({
    id: null,
    firstName: '',
    lastName: '',
    phone: '',
    email: '',
    address: ''
  });
  const [errors, setErrors] = useState({});

  useEffect(() => {
    if (customer) {
      setFormData({
        id: customer.id,
        firstName: customer.firstName,
        lastName: customer.lastName,
        phone: customer.phone,
        email: customer.email,
        address: customer.address
      });
    }
  }, [customer]);

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData(prevData => ({ ...prevData, [name]: value }));
  };

  const validate = () => {
    const { firstName, lastName, phone, email } = formData;
    const errors = {};

    if (!/^[a-zA-Z]+$/.test(firstName)) errors.firstName = 'First name must contain only letters';
    if (!/^[a-zA-Z]+$/.test(lastName)) errors.lastName = 'Last name must contain only letters';
    if (!/^\d{10}$/.test(phone)) errors.phone = 'Phone number must be exactly 10 digits';
    if (!/\S+@\S+\.\S+/.test(email)) errors.email = 'Email must be a valid email address';

    setErrors(errors);
    return Object.keys(errors).length === 0;
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    
    if (!validate()) return;

    const url = formData.id ? `http://localhost:5000/customers/${formData.id}` : 'http://localhost:5000/customers';
    const method = formData.id ? 'PUT' : 'POST';

    try {
      const response = await fetch(url, {
        method,
        headers: { 'Content-Type': 'application/json' },
        body: JSON.stringify(formData)
      });
      if (response.ok) {
        onSubmit();
      } else {
        console.error('Error:', await response.json());
      }
    } catch (error) {
      console.error('Error:', error);
    }
  };

  return (
    <form onSubmit={handleSubmit}>
      <h1>{formData.id ? 'Update' : 'Add'} Customer</h1>
      <div>
        <label>First Name:</label>
        <input
          type="text"
          name="firstName"
          value={formData.firstName}
          onChange={handleChange}
        />
        {errors.firstName && <p>{errors.firstName}</p>}
      </div>
      <div>
        <label>Last Name:</label>
        <input
          type="text"
          name="lastName"
          value={formData.lastName}
          onChange={handleChange}
        />
        {errors.lastName && <p>{errors.lastName}</p>}
      </div>
      <div>
        <label>Phone:</label>
        <input
          type="text"
          name="phone"
          value={formData.phone}
          onChange={handleChange}
        />
        {errors.phone && <p>{errors.phone}</p>}
      </div>
      <div>
        <label>Email:</label>
        <input
          type="text"
          name="email"
          value={formData.email}
          onChange={handleChange}
        />
        {errors.email && <p>{errors.email}</p>}
      </div>
      <div>
        <label>Address:</label>
        <input
          type="text"
          name="address"
          value={formData.address}
          onChange={handleChange}
        />
      </div>
      <button type="submit">{formData.id ? 'Update' : 'Add'} Customer</button>
    </form>
  );
};

export default CustomerForm;
